import react from "react";

const PricingToggle = () => {
  return (
    <div className="m-container">
      <div className="pricing-toggle-wrapper">
        <h2>PLANS</h2>
      </div>

      <style global jsx>{`
        h2 {
          color: black;
          text-align: center;
          font-size: 50px;
          font-weight: 100;
        }
      `}</style>
    </div>
  );
};

export default PricingToggle;
